import React from 'react';
import { BrowserRouter, Switch, Route } from 'react-router-dom';
import App from '../App';

const Router = () => (
    <BrowserRouter>
    <Switch>
    <Route exact path='/' component={App}/>
    <Route exact path='/recipe/:id' component={Recipe}/>
    </Switch>
    </BrowserRouter>
)

export default Router;
